import React, { Component } from "react";
import { Layout, Menu } from "antd";
import FetchContractData from "./FetchContractData";
import { DrizzleContext } from "drizzle-react";
const { Header, Content, Footer } = Layout;

const HigherOrderComponent = (WrappedComponent) => {
	const state = { buyOrders: [], sellOrders: [] };
	const handleBuyOrders = (buyOrders) => {
		this.setState({ buyOrders });
	};
	const handleSellOrders = (sellOrders) => {
		this.setState({ sellOrders });
	};
	return class Layout extends Component {
		render() {
			return (
				<React.Fragment>
					<DrizzleContext.Consumer>
						{(drizzleContext) => {
							const { drizzle, drizzleState, initialized } = drizzleContext;

							if (!initialized) {
								return "Loading...";
							}

							return (
								<React.Fragment>
									<FetchContractData
										drizzle={drizzle}
										drizzleState={drizzleState}
										handleBuyOrders={this.handleBuyOrders}
										handleSellOrders={this.handleSellOrders}
									/>
									<Layout>
										<Header
											style={{
												position: "",
												zIndex: 1,
												width: "100%",
												height: "50px",
											}}
										>
											<Menu
												theme="dark"
												mode="horizontal"
												defaultSelectedKeys={["2"]}
											>
												<Menu.Item key="1">nav 1</Menu.Item>
												<Menu.Item key="2">nav 2</Menu.Item>
												<Menu.Item key="3">nav 3</Menu.Item>
											</Menu>
										</Header>
										<Content>
											<WrappedComponent />
										</Content>
										<Footer></Footer>
									</Layout>
								</React.Fragment>
							);
						}}
					</DrizzleContext.Consumer>
				</React.Fragment>
			);
		}
	};
};

export default HigherOrderComponent;
